import * as React from 'react';
import Button from '@mui/material/Button';
import Facebook from '@mui/icons-material/Facebook';
import Twitter from '@mui/icons-material/Twitter';
import Instagram from '@mui/icons-material/Instagram';
import GitHub from '@mui/icons-material/GitHub';
import Stack from '@mui/material/Stack';
import "../styles/Footer.css"

export default function Footer() {
    return (
        <div className="Footer--div">
            <div className="Footer--Buttons">
                <Stack direction="row" spacing={10}>
                <Button variant="contained" startIcon={<Twitter />} className="Buttons--TwitterButton"></Button>
                <Button variant="contained" startIcon={<Facebook />}></Button>
                <Button variant="contained" startIcon={<Instagram />}></Button>
                <Button variant="contained" startIcon={<GitHub />}></Button>
                </Stack>
                
            </div>
        </div>
    )
}
